import React, { useState } from 'react';
import DashNavbar from '../../../layout/DashNavbar';
import { Button, Row, Col, ListGroup, ListGroupItem } from 'reactstrap';

//import DropdownInput from "react-dropdown-input";
import ServiceAdvMenu from './../ServiceAdvMenuCard';
import ServiceAdvFunctions from '../../../../Axios/ServiceAdvisorAxios';

class AddJobCards extends React.Component{

  constructor(props){
    super(props)
    this.state={
      mechanics:[]
    }
    this.onRegister=this.onRegister.bind(this)

  }

  componentDidMount(){
    ServiceAdvFunctions.getAllMechanics().then((res)=>{
      this.setState(()=>{
        return{
        mechanics:res.data
        }
      })
      /* eslint-disable */console.log(...oo_oo(`3913538239_27_6_27_39_4`,this.state.mechanics))
      this.state.mechanics.map((mech)=>{
        //console.log(mech)
      })
      
    })

  }

    onRegister (e) {
    e.preventDefault();
    const customerName = e.target.elements.customerName.value;
    const customerEmail = e.target.elements.customerEmail.value;
    const mobNo = e.target.elements.mobNo.value;
    const date = e.target.elements.date.value;
    const estimateDate = e.target.elements.estimateDate.value;
    const vehicleNo = e.target.elements.vehicleNo.value;
    const model = e.target.elements.model.value;
    const chasisNo = e.target.elements.chasisNo.value;
    const serviceType = e.target.elements.serviceType.value;
    const mechanicAssigned = e.target.elements.mechanicAssigned.value;
    const suggestedWork = e.target.elements.suggestedWork.value;
    const esitmatedBill = e.target.elements.esitmatedBill.value;

    const register = {
      customerName: customerName,
      customerEmail: customerEmail,
      mobNo: mobNo,
      date: date,
      estimateDate: estimateDate,
      vehicleNo: vehicleNo,
      model: model,
      chasisNo: chasisNo,
      serviceType: serviceType,
      mechanicAssigned: mechanicAssigned,
      suggestedWork: suggestedWork,
      esitmatedBill: esitmatedBill,
    }

    ServiceAdvFunctions.addNewJobCard(register).then((res) => {
      /* eslint-disable */console.log(...oo_oo(`3913538239_67_6_67_27_4`,res.data));

      this.props.history.push('/serviceadvisor-dash')
    })
  }

  render(){
     
  return (
    <div>
      <DashNavbar />
      <div className="py-5">
        <Row>
          <Col md={2}>
            <ServiceAdvMenu />
          </Col>

          <Col md={10}>
            <h4
              style={{
                display: 'flex',
                justifyContent: 'center',
              }}>
              Add New Job Card
            </h4>
            <br></br>
            <form onSubmit={this.onRegister}>
              <Row>
                <Col>
                  <div className="container" className="center">
                    <div className="row">
                      <div className="col">
                        <div
                          dangerouslySetInnerHTML={{
                            __html: ' &nbsp &nbsp',
                          }}></div>
                        <td colspan="">Name : </td>
                        <div
                          dangerouslySetInnerHTML={{
                            __html: ' &nbsp &nbsp',
                          }}></div>
                        <td>
                          <input
                            name="customerName"
                            className="form-control"
                            type="text"></input>
                        </td>
                        <div
                          dangerouslySetInnerHTML={{
                            __html: ' &nbsp &nbsp',
                          }}></div>
                        <td>Email :</td>
                        <div
                          dangerouslySetInnerHTML={{
                            __html: ' &nbsp &nbsp',
                          }}></div>
                        <td>
                          <input
                            name="customerEmail"
                            className="form-control"
                            type="text"></input>
                        </td>
                        <div
                          dangerouslySetInnerHTML={{
                            __html: ' &nbsp &nbsp',
                          }}></div>
                        <td>Mobile Number :</td>
                        <div
                          dangerouslySetInnerHTML={{
                            __html: ' &nbsp &nbsp',
                          }}></div>
                        <td>
                          <input
                            name="mobNo"
                            className="form-control"
                            type="text"></input>
                        </td>

                        <div
                          dangerouslySetInnerHTML={{
                            __html: ' &nbsp &nbsp',
                          }}></div>
                        <td>Date : </td>
                        <div
                          dangerouslySetInnerHTML={{
                            __html: ' &nbsp &nbsp',
                          }}></div>
                        <td>
                          <input
                            name="date"
                            className="form-control"
                            type="date"></input>
                        </td>
                      </div>

                      <div className="col">
                        <div
                          dangerouslySetInnerHTML={{
                            __html: ' &nbsp &nbsp',
                          }}></div>
                        <td>Delivery Date :</td>
                        <div
                          dangerouslySetInnerHTML={{
                            __html: ' &nbsp &nbsp',
                          }}></div>
                        <td>
                          <input
                            name="estimateDate"
                            className="form-control"
                            type="date"></input>
                        </td>
                        <div
                          dangerouslySetInnerHTML={{
                            __html: ' &nbsp &nbsp',
                          }}></div>
                        <td>Vehicle No. :</td>
                        <div
                          dangerouslySetInnerHTML={{
                            __html: ' &nbsp &nbsp',
                          }}></div>
                        <td>
                          <input
                            name="vehicleNo"
                            className="form-control"
                            type="text"></input>
                        </td>
                        <div
                          dangerouslySetInnerHTML={{
                            __html: ' &nbsp &nbsp',
                          }}></div>
                        <td>Model :</td>
                        <div
                          dangerouslySetInnerHTML={{
                            __html: ' &nbsp &nbsp',
                          }}></div>
                        <td>
                          <input
                            name="model"
